import { SET_LOGED_USER } from '../actions/logedUser'

export default function setLogedUser (state= {logedUserName: '',logedUserId :'' }, action) {
  switch (action.type) {
    case SET_LOGED_USER :
      return {
        logedUserName: action.name,
        logedUserId: action.id
      }
    default :
      return state
  }
}


